import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (<>
    <div class="mainheader">

            <div class="logo">
            <h1>Restaurant Orders Portal</h1>
            </div>
            <nav>

                <a href="#">home</a>
                <a href="/login">about</a>
                <a href="/register">register</a>
                <a href="#contact">contact</a>
            </nav>
        
        </div></>
  );
};

export default Navbar;
